public class Dyxx {
    private int id;
    private String pm;
    private String nd;
    private String cd;
    private String lb;
    private String yy;
    private String pf;
    private String pc;
    private String dy;
    private String zy;
    private String jj;
    private String bgsj;
    private String bgbs;

    public Dyxx() {
        super();
        // TODO Auto-generated constructor stub
    }

    public Dyxx(int id, String pm, String nd, String cd, String lb, String yy, String pf, String pc, String dy,
                String zy, String jj, String bgsj, String bgbs) {
        super();
        this.id = id;
        this.pm = pm;
        this.nd = nd;
        this.cd = cd;
        this.lb = lb;
        this.yy = yy;
        this.pf = pf;
        this.pc = pc;
        this.dy = dy;
        this.zy = zy;
        this.jj = jj;
        this.bgsj = bgsj;
        this.bgbs = bgbs;
    }

    public int getId() {
        return id;
    }

    public void setId(int id) {
        this.id = id;
    }

    public String getPm() {
        return pm;
    }

    public void setPm(String pm) {
        this.pm = pm;
    }

    public String getNd() {
        return nd;
    }

    public void setNd(String nd) {
        this.nd = nd;
    }

    public String getCd() {
        return cd;
    }

    public void setCd(String cd) {
        this.cd = cd;
    }

    public String getLb() {
        return lb;
    }

    public void setLb(String lb) {
        this.lb = lb;
    }

    public String getYy() {
        return yy;
    }

    public void setYy(String yy) {
        this.yy = yy;
    }

    public String getPf() {
        return pf;
    }

    public void setPf(String pf) {
        this.pf = pf;
    }

    public String getPc() {
        return pc;
    }

    public void setPc(String pc) {
        this.pc = pc;
    }

    public String getDy() {
        return dy;
    }

    public void setDy(String dy) {
        this.dy = dy;
    }

    public String getZy() {
        return zy;
    }

    public void setZy(String zy) {
        this.zy = zy;
    }

    public String getJj() {
        return jj;
    }

    public void setJj(String jj) {
        this.jj = jj;
    }

    public String getBgsj() {
        return bgsj;
    }

    public void setBgsj(String bgsj) {
        this.bgsj = bgsj;
    }

    public String getBgbs() {
        return bgbs;
    }

    public void setBgbs(String bgbs) {
        this.bgbs = bgbs;
    }

}
